import React from "react";
import styled from "styled-components";

const Cardposition = styled.div`
  width: 250px;
  height: 380px;
  border-style: solid;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Img = styled.img`
  min-height: 350px;
`;

const Cardtitle = styled.label`
  font-size: 20px;
`;

const Togglebtn = styled.button`
  position: absolute;
  left: 40px;
`;

function Card({
  key,
  address,
  color,
  corporate,
  img,
  introduce,
  logmail,
  mail,
  name,
  officenumber,
  phonenumber,
  title,
  token,
}) {
  return (
    <Cardposition>
      <Img src={img} width="250px" height="350px" />
      <div className="card_data">
        <Cardtitle className="card_title">{title}</Cardtitle>
      </div>
      <Togglebtn>더보기</Togglebtn>
    </Cardposition>
  );
}

export default Card;
